INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, "獣人族", 27, "人助けが大好き！　前向き格闘娘", "トゥインクルウィッシュ", 100101, 44, "ヒヨリ", 16, "人助け、応援", 155, "東山奈央", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, "ヒューマン", 5, "戦闘のサポートが得意な、心優しい少女", "トゥインクルウィッシュ", 100201, 47, "ユイ", 17, "料理、人間観察", 158, "種田梨沙", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, "魔族", 12, "クールで何事にも真っ直ぐな剣士", "トゥインクルウィッシュ", 100301, 46, "レイ", 18, "読書、乗馬、お茶", 163, "早見沙織", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (5, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 8, "ヒューマン", 10, "探検好きのイタズラっ子", "リトルリリカル", 100401, 27, "ミソギ", 9, "いたずら、探検", 128, "諸星すみれ", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (8, "？？？", 11, "獣人族", 25, "ヒーローに憧れる騎士見習いの少女", "王宮騎士団（NIGHTMARE）", 100501, 40, "マツリ", 12, "ヒーローごっこ", 146, "下田麻美", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 11, "魔族", 22, "甘え上手なみんなの人気者", "悪魔偽王国軍（ディアボロス）", 100601, 42, "アカリ", 13, "サックス", 150, "浅倉杏美", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, "魔族", 23, "プリン大好きゴースト娘", "悪魔偽王国軍（ディアボロス）", 100701, 32, "ミヤコ", 14, "プリンを食べること", 130, "雨宮天", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "エルフ", 10, "ボクは誰よりも美しい", "ヴァイスフリューゲル　ランドソル支部", 100801, 40, "ユキ", 14, "鏡で自分を見ること", 150, "大空直美", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 7, "魔族", 5, "前世を信じる中二病患者、「疾風の冥姫」", "トワイライトキャラバン", 100901, 45, "アンナ", 17, "小説執筆", 159, "髙野麻美", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 9, "獣人族", 22, "マホマホ王国のプリンセス", "自警団（カォン）", 101001, 42, "マホ", 16, "空想、ぬいぐるみ集め", 155, "内田真礼", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (3, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 8, "ヒューマン", 25, "人懐っこくてマシンガントークな妹系少女", "ラビリンス", 101101, 44, "リノ", 15, "お裁縫", 156, "阿澄佳奈", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (6, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 12, "エルフ", 24, "みんなのために超能力を使う眠り姫", "フォレスティエ", 101201, 46, "ハツネ", 17, "妹と遊ぶこと、二度寝、昼寝、早寝", 156, "大橋彩香", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "", 8, "魔族", 21, "オタク全開な魔法少女", "トワイライトキャラバン", 101301, 55, "ナナカ", 18, "読書、魔法", 166, "佳村はるか", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (10, "test", 11, "獣人族", 3, "頭脳明晰な美少女名探偵", "自警団（カォン）", 101401, 41, "カスミ", 15, "読書、推理", 152, "水瀬いのり", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (6, "test", 9, "エルフ", 5, "母性溢れる優しいみんなの「ミサト先生」", "フォレスティエ", 101501, 54, "ミサト", 21, "絵本作り", 165, "國府田マリ子", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, "魔族", 10, "天真爛漫で人気者のカリスマモデル", "ルーセント学院", 101601, 48, "スズナ", 18, "ファッション", 167, "上坂すみれ", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "獣人族", 7, "いつでも「なんくるないさ～」な天然娘", "自警団（カォン）", 101701, 53, "カオリ", 19, "踊り、空手", 158, "高森奈津美", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 8, "魔族", 14, "多くの男性を魅了する無垢な女教師", "ルーセント学院", 101801, 52, "イオ", 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 162, "伊藤静", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (5, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 4, "獣人族", 3, "お歌もにんじんも、ウサギさんも大好き♪", "リトルリリカル", 102001, 21, "ミミ", 10, "かわいいもの集め", 117, "日高里菜", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, "ヒューマン", 9, "泣き虫で臆病な守ってあげたい女の子", "サレンディア救護院", 102101, 40, "クルミ", 12, "観劇、おままごと", 150, "植田佳奈", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 11, "魔族", 22, "人見知りであまのじゃくな女の子", "悪魔偽王国軍（ディアボロス）", 102201, 40, "ヨリ", 13, "ゲーム全般", 150, "原紗友里", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, "ヒューマン", 10, "ぷうきちといつも一緒！", "サレンディア救護院", 102301, 38, "アヤネ", 14, "屋内でできる遊び", 148, "芹澤優", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "ヒューマン", 12, "お嬢さまのためにがんばるドジっ娘メイド", "サレンディア救護院", 102501, 43, "スズメ", 15, "ご奉仕", 154, "悠木碧", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (11, "test", 1, "獣人族", 1, "遊びと睡眠が何より大事なぐうたら娘", "牧場（エリザベスパーク）", 102601, 42, "リン", 17, "あんパン", 144, "小岩井ことり", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, "魔族", 30, "運命の相手に一途すぎる乙女", "トワイライトキャラバン", 102701, 43, "エリコ", 16, "実験、裁縫、料理", 154, "橋本ちなみ", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 10, "エルフ", 4, "救護院を経営する優しい庶民派お嬢様", "サレンディア救護院", 102801, 43, "サレン", 17, "経営、お茶会", 156, "堀江由衣", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (4, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 1, "ヒューマン", 24, "歌って踊れる大人気アイドル", "カルミナ", 102901, 40, "ノゾミ", 17, "舞台鑑賞、ダンス", 157, "日笠陽子", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, "ヒューマン", 31, "トーゴクの神秘、オシエテクダサイ！", "ヴァイスフリューゲル　ランドソル支部", 103001, 51, "ニノン", 16, "忍法開発", 163, "佐藤聡美", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, "魔族", 22, "占いが得意な霊能少女", "悪魔偽王国軍（ディアボロス）", 103101, 42, "シノブ", 18, "占い", 157, "大坪由佳", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 3, "ヒューマン", 12, "一人前の商人を目指すパワフルお嬢様", "メルクリウス財団", 103201, 45, "アキノ", 18, "慈善事業", 157, "松嵜麗", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (11, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "ヒューマン", 3, "みんなを笑顔にするお笑い牧場主", "牧場（エリザベスパーク）", 103301, 35, "マヒル", 20, "漫才", 142, "新田恵海", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 3, "エルフ", 16, "純情でほっとけない大人の女性", "メルクリウス財団", 103401, 55, "ユカリ", 22, "ウインドーショッピング", 164, "今井麻美", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (5, "test", 2, "エルフ", 2, "礼儀正しくしっかり者のちびっ子優等生", "リトルリリカル", 103601, 21, "キョウカ", 8, "お勉強", 118, "小倉唯", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (8, "test", 8, "ヒューマン", 11, "義理堅くてからかい好きな剣術少女", "王宮騎士団（NIGHTMARE）", 103701, 43, "トモ", 13, "剣術、年長者をからかう", 149, "茅原実里", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, "獣人族", 3, "読書が趣味の病弱少女", "牧場（エリザベスパーク）", 103801, 40, "シオリ", 14, "読書、お散歩", 153, "小清水亜美", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "エルフ", 6, "「友達」に憧れる、エルフの森の女の子", "フォレスティエ", 104001, 44, "アオイ", 13, "友達作りのイメトレ", 158, "花澤香菜", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, "ヒューマン", 3, "人々を守るために歌う、唱喚士の少女", "カルミナ", 104201, 46, "チカ", 17, "各種楽器", 163, "福原綾香", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (10, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 8, "獣人族", 9, "男勝りで情に厚いワイルド娘", "自警団（カォン）", 104301, 54, "マコト", 17, "お菓子作り", 168, "小松未可子", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "test", 5, "魔族", 5, "かつては夜を支配した最強の吸血鬼", "悪魔偽王国軍（ディアボロス）", 104401, 50, "イリヤ", "??", "世界征服", 172, "丹下桜", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, "ヒューマン", 19, "妄想大好き！　ほんとは照れ屋な女の子", "ヴァイスフリューゲル　ランドソル支部", 104501, 49, "クウカ", 18, "小説を読むこと", 157, "長妻樹里", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, "獣人族", 1, "弱きを助け強きをくじく猫娘", "メルクリウス財団", 104601, 48, "タマキ", 18, "猫とたわむれること", 158, "沼倉愛美", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (8, "？？？", 10, "ヒューマン", 25, "素顔を見せない冷静沈着な女性騎士", "王宮騎士団（NIGHTMARE）", 104701, 50, "ジュン", 25, "格闘技、湯浴み", 171, "川澄綾子", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "ヒューマン", 11, "仕事も私事も効率優先な傭兵少女", "メルクリウス財団", 104801, 49, "ミフユ", 20, "傭兵などのアルバイト", 163, "田所あずさ", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, "ヒューマン", 24, "お姉ちゃんがお世話してあげるからねっ！", "ラビリンス", 104901, 54, "シズル", 18, "家事全般", 168, "生天目仁美", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, "魔族", 3, "ちょっとおませな恋に恋する女の子", "ルーセント学院", 105001, 22, "ミサキ", 11, "ファッション誌鑑賞、コスメ集め", 120, "久野美咲", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 3, "ヒューマン", 7, "実験が趣味の危険な科学者", "トワイライトキャラバン", 105101, 53, "ミツキ", 27, "研究、実験", 166, "三石琴乃", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (11, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 3, "獣人族", 14, "乙女チックなもふもふアニマル", "牧場（エリザベスパーク）", 105201, 100, "リマ", 18, "毛繕い、お喋り", 150, "徳井青空", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 7, "ヒューマン", 28, "見た目も中身もお子ちゃまな異国の軍人", "ヴァイスフリューゲル　ランドソル支部", 105301, 33, "モニカ", 18, "お菓子屋通い", 140, "辻あゆみ", 0, "A");
