INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 3, "ヒューマン", 10, "空への冒険を夢見る騎空士の少女", "？？？", 105701, 45, "ジータ", 17, "冒険、おしゃべり", 156, "金元寿子", 0, "O");
