INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "ヒューマン", 12, "お嬢さまのためにがんばるドジっ娘メイド", "サレンディア救護院", 107701, 43, "スズメ（サマー）", 15, "ご奉仕", 154, "悠木碧", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (1, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 9, "獣人族", 2, "行き倒れの謎のネコミミ魔法使い", "美食殿", 107801, 39, "キャル（サマー）", 14, "猫と遊ぶ", 152, "立花理香", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, "獣人族", 1, "弱きを助け強きをくじく猫娘", "メルクリウス財団", 107901, 48, "タマキ（サマー）", 18, "猫とたわむれること", 158, "沼倉愛美", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "ヒューマン", 11, "仕事も私事も効率優先な傭兵少女", "メルクリウス財団", 108001, 49, "ミフユ（サマー）", 20, "傭兵などのアルバイト", 163, "田所あずさ", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, "魔族", 22, "占いが得意な霊能少女", "悪魔偽王国軍（ディアボロス）", 108101, 42, "シノブ（ハロウィン）", 18, "占い", 157, "大坪由佳", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, "魔族", 23, "プリン大好きゴースト娘", "悪魔偽王国軍（ディアボロス）", 108201, 32, "ミヤコ（ハロウィン）", 14, "プリンを食べること", 130, "雨宮天", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, "魔族", 3, "ちょっとおませな恋に恋する女の子", "ルーセント学院", 108301, 22, "ミサキ（ハロウィン）", 11, "ファッション誌鑑賞、コスメ集め", 120, "久野美咲", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, "ヒューマン", 3, "人々を守るために歌う、唱喚士の少女", "カルミナ", 108401, 46, "チカ（クリスマス）", 17, "各種楽器", 163, "福原綾香", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, "ヒューマン", 9, "泣き虫で臆病な守ってあげたい女の子", "サレンディア救護院", 108501, 40, "クルミ（クリスマス）", 12, "観劇、おままごと", 150, "植田佳奈", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, "ヒューマン", 10, "ぷうきちといつも一緒！", "サレンディア救護院", 108601, 38, "アヤネ（クリスマス）", 14, "屋内でできる遊び", 148, "芹澤優", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, "獣人族", 27, "人助けが大好き！　前向き格闘娘", "トゥインクルウィッシュ", 108701, 44, "ヒヨリ（ニューイヤー）", 16, "人助け、応援", 155, "東山奈央", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, "ヒューマン", 5, "戦闘のサポートが得意な、心優しい少女", "トゥインクルウィッシュ", 108801, 47, "ユイ（ニューイヤー）", 17, "料理、人間観察", 158, "種田梨沙", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, "魔族", 12, "クールで何事にも真っ直ぐな剣士", "トゥインクルウィッシュ", 108901, 46, "レイ（ニューイヤー）", 18, "読書、乗馬、お茶", 163, "早見沙織", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, "魔族", 30, "運命の相手に一途すぎる乙女", "トワイライトキャラバン", 109001, 43, "エリコ（バレンタイン）", 16, "実験、裁縫、料理", 154, "橋本ちなみ", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, "ヒューマン", 24, "お姉ちゃんがお世話してあげるからねっ！", "ラビリンス", 109101, 54, "シズル（バレンタイン）", 18, "家事全般", 168, "生天目仁美", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 12, "ヒューマン", 1, "英霊と契約を結んだマナリアの天才王女", "？？？", 109201, 55, "アン", 17, "読書", 156, "日笠陽子", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 2, "ヒューマン", 4, "マナリア魔法学院の新入生", "？？？", 109301, 45, "ルゥ", 15, "食べること、眠ること", 144, "こやまきみこ", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES ("", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 11, "半人半竜", 3, "人を超越した力を有す心優しい竜姫", "？？？", 109401, 67, "グレア", 17, "ピアノ", 167, "福原綾香", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, "ヒューマン", 19, "妄想大好き！　ほんとは照れ屋な女の子", "ヴァイスフリューゲル　ランドソル支部", 109501, 49, "クウカ（オーエド）", 18, "小説を読むこと", 157, "長妻樹里", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, "ヒューマン", 31, "トーゴクの神秘、オシエテクダサイ！", "ヴァイスフリューゲル　ランドソル支部", 109601, 51, "ニノン（オーエド）", 16, "忍法開発", 163, "佐藤聡美", 0, "O");
