INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, "獣人族", 1, "弱きを助け強きをくじく猫娘", "メルクリウス財団", 116801, 48, "タマキ（作業服）", 18, "猫とたわむれること", 158, "沼倉愛美", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "ヒューマン", 11, "仕事も私事も効率優先な傭兵少女", "メルクリウス財団", 116901, 49, "ミフユ（作業服）", 20, "傭兵などのアルバイト", 163, "田所あずさ", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, "魔族", 30, "運命の相手に一途すぎる乙女", "トワイライトキャラバン", 117001, 43, "エリコ（サマー）", 16, "実験、裁縫、料理", 154, "橋本ちなみ", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, "ヒューマン", 24, "お姉ちゃんがお世話してあげるからねっ！", "ラビリンス", 117101, 54, "シズル（サマー）", 18, "家事全般", 168, "生天目仁美", 0, "O");
