INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, "ヒューマン", 3, "人々を守るために歌う、唱喚士の少女", "カルミナ", 117301, 46, "チカ（サマー）", 17, "各種楽器", 163, "福原綾香", 0, "O");
