INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 3, "ヒューマン", 7, "実験が趣味の危険な科学者", "トワイライトキャラバン", 117501, 53, "ミツキ（オーエド）", 27, "研究、実験", 166, "三石琴乃", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "エルフ", 10, "ボクは誰よりも美しい", "ヴァイスフリューゲル　ランドソル支部", 117601, 40, "ユキ（オーエド）", 14, "鏡で自分を見ること", 150, "大空直美", 0, "AB");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "獣人族", 7, "いつでも「なんくるないさ～」な天然娘", "自警団（カォン）", 117701, 53, "カオリ（ハロウィン）", 19, "踊り、空手", 158, "高森奈津美", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, "ヒューマン", 31, "トーゴクの神秘、オシエテクダサイ！", "ヴァイスフリューゲル　ランドソル支部", 117801, 51, "ニノン（ハロウィン）", 16, "忍法開発", 163, "佐藤聡美", 0, "O");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, "魔族", 10, "天真爛漫で人気者のカリスマモデル", "ルーセント学院", 117901, 48, "スズナ（ハロウィン）", 18, "ファッション", 167, "上坂すみれ", 0, "O");
