INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, "魔族", 3, "ちょっとおませな恋に恋する女の子", "ルーセント学院", 121401, 22, "ミサキ（ステージ）", 11, "ファッション誌鑑賞、コスメ集め", 120, "久野美咲", 0, "A");
