INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 7, "魔族", 5, "前世を信じる中二病患者、「疾風の冥姫」", "トワイライトキャラバン", 121901, 45, "アンナ（パイレーツ）", 17, "小説執筆", 159, "髙野麻美", 0, "A");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, "魔族", 22, "占いが得意な霊能少女", "悪魔偽王国軍（ディアボロス）", 122001, 42, "シノブ（パイレーツ）", 18, "占い", 157, "大坪由佳", 0, "AB");
