INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 3, "エルフ", 16, "純情でほっとけない大人の女性", "メルクリウス財団", 122201, 55, "ユカリ（キャンプ）", 22, "ウインドーショッピング", 164, "今井麻美", 0, "A");
