INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, "魔族", 12, "クールで何事にも真っ直ぐな剣士", "トゥインクルウィッシュ", 122501, 46, "レイ（サマー）", 18, "読書、乗馬、お茶", 163, "早見沙織", 0, "B");
INSERT INTO `v1_79a84de828c0a81d9705a4f08efc4f71ab78e197932759fe6e33bb8960ffb8c2` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, "ヒューマン", 5, "戦闘のサポートが得意な、心優しい少女", "トゥインクルウィッシュ", 122601, 47, "ユイ（サマー）", 17, "料理、人間観察", 158, "種田梨沙", 0, "O");
